import React from "react";
import Header from "./Header.js";
import Footer from "./Footer.js";
import Notes from "./Notes.js";
import notes from "../notes.js";


function App(){
    return (
        <div>
          <Header />
        { notes.map((n) => (
         <Notes key = {n.id}
         note_title = {n.title}
         note_content = {n.content}
           />

        ))}
          <Footer />
        </div>
    );

}

export default App;
